import Model from '../models/model.js';
import leftMenu from './components/leftMenu'
export default function FakeStackOverflow() {
  return (
    <>
      <div class="header">
          <h1 id="header">Fake Stack Overflow</h1>
          <input type="text" placeholder="Search ..." id="search" /> 
      </div>
      <LeftMenu />
    </>
  );
}
